import React, { useState } from 'react';
import Head from 'next/head';
import { AppProps } from 'next/app';
import Layout from '../components/Layout';
import Blank from '../components/ContainerComponents/blank'


class Index extends React.Component {
  static async getInitialProps () {
    const res = await fetch('https://api.pokemontcg.io/v1/cards?pages=1&pageSize=10')
    const data = await res.json()
    return data;
}
  constructor(props) {
    super(props);
    this.state = {
      counters: 0,
      create: "thanh"
    }
  }
  render() {
    return (
      <div>
      {this.props.cards.map((card, i) => (
          <div key={i} style={{width: 200, float: 'left'}}>
          <div  style={{margin: 10}}>
                  <img src={card.imageUrl} style={{width: 160}}/>
              </div>
          </div>
      ))}
      </div>
    )
  }
}
export default Index;
